curl -XPOST 'http://localhost:9200/electronic_products/_create/3085' -H 'Content-Type: application/json' -d '{"product_name": "SGM9147", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The SGM9147 is a single rail-to-rail 5th-order output  reconstruction filter which can operate from 3.0V to  5.5V single power supply, while consuming an ultra-low  5mA quiescent current. The device is optimized for low  power, battery-operated applications.  The device has a -3dB bandwidth of 13MHz and  60V/µs slew rate, allowing DC-coupled output. An  internal level shift circuit avoids synchronous pulse  limit.  The SGM9147 is available in a Green SC70-5 package.  It operates over an ambient temperature range of -40℃  to +85℃.    "}'
